export function getWeatherApi(){
    return fetch("https://weather.visualcrossing.com/VisualCrossingWebServices/rest/services/timeline/melbourne?unitGroup=metric&elements=datetime%2CdatetimeEpoch%2Ctempmax%2Ctempmin%2Ctemp%2Cfeelslike%2Csunrise%2Csunset&key=JB7CB9FV8WLE3SE7N3AYLFWT9&contentType=json", {
        "method": "GET",
        "headers": {
            'Content-Type': 'application/json'
        }
        })
      .then(response => response.json())
      .then(data => data);
}
